import axios from 'axios';
import React, { useState } from 'react'

const ManageServices = () => {
  const [service,setService] = useState('');
  const handleChange = (e)=>{
    setService({...service,[e.target.name]:e.target.value})
  }
  const handleSubmit =()=>{
      axios.post(`http://localhost:8080/request/save/${service}`).then((Response)=>{
        console.log(Response.data);
        alert("Service added");
        
      })
  }
  return (
    <>
    <input type="text" name="service" id="service" value={service} onChange={handleChange}placeholder='New service' />
    <button type="submit" onClick={handleSubmit}>Add Service</button>
    </>

  )
}

export default ManageServices
